import React, { useEffect, useState } from "react";
import "../css/Match.css";
import MatchDisplay from "./MatchDisplay";
import CsvHeader from "./CsvHeader";
import { Redirect, Link } from "react-router-dom";

const Match = ({
  file,
  data,
  backEndHeaders,
  updateData,
  updateHeader,
  setFrame,
}) => {
  const [headers, setHeaders] = useState([]);
  console.log(headers, "headers")
  useEffect(() => {
    if (data.length > 0) {
      const createHeaders = Object.keys(data[0]).map((header) => {
        const obj = {
          name: header,
          matchedWith: [],
          confirmed: false,
        };
        return obj;
      });
      headerMatch(createHeaders);
    }
  }, [data]);

  const headerMatch = (list) => {
    const matching = list.map((header) => {
      const backendMatch = backEndHeaders.filter(
        (item) => header === item.name || item.altNames.includes(header)
      );
      header.matchedWith = backendMatch;
    });
    setHeaders(matching);
  };

  if (file) {
    return (
      <div className="match">
        <div className="match-header">
          <h3>{file.name}</h3>
        </div>
        <MatchDisplay />
      </div>
    );
  } else {
    return <Redirect to="/" />;
  }
};

export default Match;
